import "./App.css";
import JumbotronComp from "./components/JumbotronComp";
import Users from './components/Users';
import AddUser from './components/AddUser';

export default class App extends Component {



  render() {
    return (
    <div>
      <JumbotronComp/>
        <div>
          <div className="col-md-4">
                <div className="mb-2">
                <AddUser/>
                <Users />
                </div>

            </div>
          </div>
    </div>
        );
      }
    }
